import React, { Component } from 'react'

export default class Profile extends Component {
    constructor(){
        super(); 
        this.state = {
           data : [{}],
           loading : true 
        }
    }
    async componentDidMount(){
        const profile = await fetch('https://api.github.com/users/Abhishekdileep');
        const profileJSON = profile.json();
        if(profileJSON){
            this.setState({
                data : {...this.state.data , profileJSON },
                loading : false

            })
        }
    }
    render() {
        return (
            <div>
              <h1> Hear My Profile comes </h1>  
            </div>
        )
    }
}
